import { Form, FormGroup, FormText, Button } from 'reactstrap';

const AddCourse=()=>{

    return (
     <Fragment>
      <Form>
        <FormGroup>
          <label>Course Id</label>
          <Input></Input>
        </FormGroup>
      </Form>
     </Fragment>
    );
}

export default AddCourse;
